import { useState } from "react";
import { Circle, Square, Triangle } from "./shapes";
import { Slider } from "./slider";

export default function Home() {
  const [state, setState] = useState<number>(0);

  return (
    <div className="px-10">
      <Slider
        className="w-full max-w-3xl mx-auto mt-5"
        stops={[
          <Square className="fill-[#AB87FF]" />,
          <Circle className="fill-[#446DF6]" />,
          <Triangle className="fill-[#FBB02D]" />,
          <Square className="fill-[#ACECA1]" />,
          <Circle className="fill-[#FFFF4C]" />,
          <Square className="fill-[#FE65B7]" />,
        ]}
        value={state}
        onChange={(value: number) => setState(value)}
      />
    </div>
  );
}
